                    "id": 73,
                    "profileId": "3",
                    "pubId": "2",
                    "contentResponse": "{\"name\": \"Highlights of Shantang Street\", \"appId\": \"tripWed3\", \"image\": \"ipfs://QmUaVwqqSkYTh7FAAQ6nY8E6RZ4DwVD1kxSjLYfNuo7KR5\", \"state\": \"public\", \"title\": \"Highlights of Shantang Street\", \"content\": \"<p><span style=\\\"color: rgb(15, 41, 77);\\\">Shantang Ancient Street is an ancient commercial street along the Shantang River in Northwest Suzhou. It boasts 1000 years of history and was built by the Tang Dynasty poet Bai Juyi when he was a government official in Suzhou. Today, at the southern end of the street, there is a temple built to commemorate him. Ancient bridges span across the river canals, and both sides of the canals are lined with old houses and traditional shops. In the evening, the red lanterns lining the street are reflected in the river, creating a picturesque scenery. You can take a boat ride for a fee, or find a tea house to drink tea and listen to traditional Suzhou Pingtan.</span></p>\", \"attributes\": [{\"value\": 8, \"trait_type\": \"category\", \"display_type\": \"景点\"}, {\"value\": 1, \"trait_type\": \"content_type\", \"display_type\": \"攻略游记\"}], \"metadata_id\": \"7f88b1af-c6a3-4a3d-a380-47cb671d79aa\"}",
