                    "contentResponse": "{\"name\": \"泰国 皮皮岛\", \"appId\": \"tripWed3\", \"image\": \"ipfs://QmVeRWBBgPwhoNdZwnq68JTU9B1jm7smcLpnpAvSvdJcgt\", \"state\": \"public\", \"title\": \"泰国 皮皮岛\", \"content\": \"<p>皮皮岛上郁郁葱葱的大地与绿松石般的海水交相呼应</p><p>凭着2000年拍摄的电影《海滩》而一举成名的泰国&nbsp;<a href=\\\"https://www.booking.com/city/th/phi-phi-don.zh-cn.html?aid=357003&amp;label=gog235jc-1DEghhcnRpY2xlcyiCAjjoB0grWANoO4gBAZgBK7gBB8gBDNgBA-gBAfgBAogCAagCA7gC9rCgpQbAAgHSAiQ3MDM4OTI1Yi0zNTg4LTQ0YzctODRlNS0wM2Q0MmJhNWFkN2TYAgTgAgE&amp;sid=73abf385988002f8bc1b4c0cd79535d4\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: var(--bui_color_action_foreground);\\\">皮皮岛</a>&nbsp;，每天都吸引着成千上万的游客。寻找五彩生物的人，当然不只你一个，彩虹般的鹦鹉鱼和条纹豆娘鱼在你不远处畅游的画面绝对是令人难忘的经历。皮皮岛热门的浮潜点包括 Hin Klang、Monkey Bay、Loh Sama以及Pi Leh。</p><p>浮潜结束后，可以在&nbsp;<a href=\\\"https://www.booking.com/hotel/th/phi-phi-phu-chalet-beach-resort.zh-cn.html?aid=357003&amp;label=gog235jc-1DEghhcnRpY2xlcyiCAjjoB0grWANoO4gBAZgBK7gBB8gBDNgBA-gBAfgBAogCAagCA7gC9rCgpQbAAgHSAiQ3MDM4OTI1Yi0zNTg4LTQ0YzctODRlNS0wM2Q0MmJhNWFkN2TYAgTgAgE&amp;sid=73abf385988002f8bc1b4c0cd79535d4\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: var(--bui_color_action_foreground);\\\">披披岛小木屋度假酒店</a>&nbsp;享用当地美食，在泳池边来杯鸡尾酒，放松身心<img src=\\\"data:image/jpeg;base64,\\\"></p>\", \"attributes\": [{\"value\": 8, \"trait_type\": \"category\", \"display_type\": \"景点\"}, {\"value\": 1, \"trait_type\": \"content_type\", \"display_type\": \"攻略游记\"}], \"metadata_id\": \"6f7f3b65-b159-4bc9-a715-11d34e887e8d\"}",
